const axios = require("axios");
const cheerio = require("cheerio");
const { URL } = require("url");

class PageAnalysis {
  constructor(url) {
    this.url = url;
    this.internalLinks = new Map();
    this.externalLinks = new Map();
    this.incomingLinks = new Set();
  }
}

async function analyzeDomain(domain) {
  const visited = new Set();
  const toVisit = [domain];
  const pageAnalyses = new Map();

  while (toVisit.length > 0) {
    const currentUrl = toVisit.pop();
    if (visited.has(currentUrl)) continue;
    visited.add(currentUrl);

    try {
      const response = await axios.get(currentUrl, { timeout: 5000 });
      const $ = cheerio.load(response.data);

      const currentPageAnalysis = new PageAnalysis(currentUrl);
      pageAnalyses.set(currentUrl, currentPageAnalysis);

      $("a[href]").each((_, element) => {
        let href = $(element).attr("href");
        const anchorText = $(element).text().trim();

        if (!href) return;

        if (href.startsWith("/")) {
          href = new URL(href, domain).href;
        }

        if (href.startsWith(domain)) {
          currentPageAnalysis.internalLinks.set(href, anchorText);

          if (!visited.has(href)) {
            toVisit.push(href);
          }

          if (!pageAnalyses.has(href)) {
            pageAnalyses.set(href, new PageAnalysis(href));
          }
          pageAnalyses.get(href).incomingLinks.add(currentUrl);
        } else {
          currentPageAnalysis.externalLinks.set(href, anchorText);
        }
      });
    } catch (error) {
      console.error(`Error analyzing ${currentUrl}: ${error.message}`);
    }
  }

  return pageAnalyses;
}

async function main(domain) {
  try {
    const pageAnalyses = await analyzeDomain(domain);
    const sitemap = generateSitemap(Array.from(pageAnalyses.keys()));
    const report = generateAnalysisReport(pageAnalyses);
    const chartData = generateChartData(pageAnalyses);
    const visualization = generateVisualizationHtml({ chartData });

    return {
      sitemap,
      report,
      visualization,
    };
  } catch (error) {
    return { error: error.message };
  }
}

